import React from "react";
import { Layout } from "../components";
import { Container, Row, Col } from "reactstrap";

const Home = () => {
  return (
    <Layout>
      <div className="main-banner">
        <Container>
          <Row>
            <Col></Col>
          </Row>
        </Container>
      </div>
    </Layout>
  );
};

export default Home;
